INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 0.0, 0, 0, 1, 7001, -363.0, "2015/12/17 15:00:00", "キャル", 1, 1, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 7, 106001, 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 0.0, 0, 0, 1, 7002, -363.0, "2015/12/17 15:00:00", "コッコロ", 1, 1, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", 7, 105901, 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 0.0, 0, 0, 1, 7003, -363.0, "2015/12/17 15:00:00", "ペコリーヌ", 1, 1, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", 7, 105801, 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 0.0, 0, 0, 1, 10001, -363.0, "2015/12/17 15:00:00", "ペコリーヌ", 1, 1, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", 10, 105801, 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 0.0, 0, 0, 1, 10002, -363.0, "2015/12/17 15:00:00", "キャル", 1, 1, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", 10, 106001, 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 0.0, 0, 0, 1, 10003, -363.0, "2015/12/17 15:00:00", "コッコロ", 1, 1, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", 10, 105901, 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 0.0, 2104010, 0, 1, 10004, -363.0, "2015/12/17 15:00:00", "シェフィ", 1, 2, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", 10, 106401, 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 0.0, 0, 0, 1, 12001, -416.5, "2015/12/17 15:00:00", "ペコリーヌ", 1, 1, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", 12, 105801, 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 0.0, 0, 0, 1, 13001, -363.0, "2015/12/17 15:00:00", "キャル", 1, 1, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", 13, 106001, 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 0.0, 0, 0, 1, 13002, -363.0, "2015/12/17 15:00:00", "コッコロ", 1, 1, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", 13, 105901, 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 0.0, 2104010, 0, 1, 13003, -363.0, "2015/12/17 15:00:00", "シェフィ", 1, 2, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", 13, 106401, 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 0.0, 0, 0, 1, 13004, -363.0, "2015/12/17 15:00:00", "ペコリーヌ", 1, 1, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", 13, 105801, 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 0.0, 0, 0, 1, 14001, -363.0, "2015/12/17 15:00:00", "コッコロ", 1, 1, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", 14, 105901, 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 0.0, 2104010, 0, 1, 14002, -363.0, "2015/12/17 15:00:00", "シェフィ", 1, 2, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", 14, 106401, 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 0.0, 0, 0, 1, 14003, -363.0, "2015/12/17 15:00:00", "ペコリーヌ", 1, 1, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", 14, 105801, 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 0.0, 0, 0, 1, 14004, -363.0, "2015/12/17 15:00:00", "キャル", 1, 1, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", 14, 106001, 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 0.0, 0, 0, 1, 15001, -470.0, "2015/12/17 15:00:00", "コッコロ", 1, 1, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", 15, 105901, 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 0.0, 2104010, 0, 1, 16001, -363.0, "2015/12/17 15:00:00", "シェフィ", 1, 2, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", 16, 106401, 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 0.0, 0, 0, 1, 16002, -363.0, "2015/12/17 15:00:00", "ペコリーヌ", 1, 1, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", 16, 105801, 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 0.0, 0, 0, 1, 16003, -363.0, "2015/12/17 15:00:00", "キャル", 1, 1, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", 16, 106001, 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 0.0, 0, 0, 1, 16004, -363.0, "2015/12/17 15:00:00", "コッコロ", 1, 1, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", 16, 105901, 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 0.0, 0, 0, 1, 17002, -363.0, "2015/12/17 15:00:00", "コッコロ", 1, 1, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", 17, 105901, 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 0.0, 0, 0, 1, 17004, -363.0, "2015/12/17 15:00:00", "キャル", 1, 1, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", 25, 106001, 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 0.0, 0, 0, 1, 17005, -363.0, "2015/12/17 15:00:00", "コッコロ", 1, 1, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", 25, 105901, 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 0.0, 2104010, 0, 1, 17006, -363.0, "2015/12/17 15:00:00", "シェフィ", 1, 2, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", 25, 106401, 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 0.0, 0, 0, 1, 17007, -363.0, "2015/12/17 15:00:00", "ペコリーヌ", 1, 1, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", 25, 105801, 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 0.0, 0, 0, 1, 18001, -363.0, "2015/12/17 15:00:00", "カリン", 1, 1, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", 18, 190801, 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 0.0, 0, 0, 2, 18002, -363.0, "2015/12/17 15:00:00", "カリン", 1, 1, "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", 18, 190801, 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 0.0, 0, 0, 3, 19001, -470.0, "2015/12/17 15:00:00", "カリン", 1, 1, "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", 19, 190801, 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 0.0, 0, 0, 4, 19002, -470.0, "2015/12/17 15:00:00", "カリン", 1, 1, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", 19, 190801, 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 0.0, 0, 0, 5, 20001, -470.0, "2015/12/17 15:00:00", "カリン", 1, 1, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", 20, 190801, 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 0.0, 0, 0, 6, 20002, -470.0, "2015/12/17 15:00:00", "カリン", 1, 1, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", 20, 190801, 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 0.0, 0, 0, 1, 21001, -363.0, "2015/12/17 15:00:00", "キャル", 1, 1, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", 21, 106001, 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 0.0, 0, 0, 1, 21002, -363.0, "2015/12/17 15:00:00", "コッコロ", 1, 1, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", 21, 105901, 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 0.0, 2104010, 0, 1, 21003, -363.0, "2015/12/17 15:00:00", "シェフィ", 1, 2, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", 21, 106401, 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 0.0, 0, 0, 1, 21004, -363.0, "2015/12/17 15:00:00", "ペコリーヌ", 1, 1, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", 21, 105801, 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 0.0, 0, 0, 1, 22001, -430.0, "2015/12/17 15:00:00", "カリン", 1, 1, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", 22, 190801, 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 0.0, 0, 0, 2, 22002, -430.0, "2015/12/17 15:00:00", "カリン", 1, 1, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", 22, 190801, 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 0.0, 0, 0, 3, 23001, -430.0, "2015/12/17 15:00:00", "カリン", 1, 1, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", 23, 190801, 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 0.0, 0, 0, 4, 23002, -430.0, "2015/12/17 15:00:00", "カリン", 1, 1, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", 23, 190801, 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 8.0, 0, 10011, 1, 24001, -385.0, "2019/01/31 12:00:00", "エリコ（バレンタイン）", 2, 1, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 24, 109001, 4.08);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 8.0, 0, 10011, 2, 24002, -385.0, "2019/01/31 12:00:00", "エリコ（バレンタイン）", 2, 1, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 24, 109001, 5.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 8.0, 0, 10011, 3, 24003, -385.0, "2019/01/31 12:00:00", "エリコ（バレンタイン）", 2, 1, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 24, 109001, 10.11);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 8.0, 0, 10011, 4, 24004, -385.0, "2019/01/31 12:00:00", "エリコ（バレンタイン）", 2, 1, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 24, 109001, 4.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 8.0, 0, 10011, 5, 24005, -385.0, "2019/01/31 12:00:00", "エリコ（バレンタイン）", 2, 1, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 24, 109001, 6.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 0.0, 0, 10011, 6, 24006, 0.0, "2019/01/31 12:00:00", "エリコ（バレンタイン）", 1, 1, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 24, 109002, 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 0.0, 0, 10011, 7, 24007, 0.0, "2019/01/31 12:00:00", "エリコ（バレンタイン）", 1, 1, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 24, 109002, 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 0.0, 0, 10011, 8, 24008, 0.0, "2019/01/31 12:00:00", "エリコ（バレンタイン）", 1, 1, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 24, 109002, 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 0.0, 0, 10011, 9, 24009, 0.0, "2019/01/31 12:00:00", "エリコ（バレンタイン）", 1, 1, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 24, 109002, 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 0.0, 0, 10011, 10, 24010, 0.0, "2019/01/31 12:00:00", "エリコ（バレンタイン）", 1, 1, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 24, 109002, 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 8.0, 0, 10011, 1, 24011, -385.0, "2019/01/31 12:00:00", "シズル（バレンタイン）", 2, 1, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 24, 109101, 2.12);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 8.0, 0, 10011, 2, 24012, -385.0, "2019/01/31 12:00:00", "シズル（バレンタイン）", 2, 5, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", 24, 109101, 4.19);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 8.0, 0, 10011, 3, 24013, -385.0, "2019/01/31 12:00:00", "シズル（バレンタイン）", 4, 2, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", 24, 109101, 2.3);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 0.0, 0, 10011, 4, 24014, 0.0, "2019/01/31 12:00:00", "シズル（バレンタイン）", 1, 1, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", 24, 109102, 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 8.0, 0, 10011, 5, 24015, -385.0, "2019/01/31 12:00:00", "シズル（バレンタイン）", 2, 5, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", 24, 109101, 5.23);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 0.0, 0, 10011, 6, 24016, 0.0, "2019/01/31 12:00:00", "シズル（バレンタイン）", 1, 1, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 24, 109102, 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 8.0, 0, 10011, 7, 24017, -385.0, "2019/01/31 12:00:00", "シズル（バレンタイン）", 2, 1, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", 24, 109101, 5.01);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 0.0, 0, 10011, 8, 24018, 0.0, "2019/01/31 12:00:00", "シズル（バレンタイン）", 1, 1, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", 24, 109102, 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 0.0, 0, 10011, 9, 24019, 0.0, "2019/01/31 12:00:00", "シズル（バレンタイン）", 1, 1, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", 24, 109102, 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 0.0, 0, 10011, 10, 24020, 0.0, "2019/01/31 12:00:00", "シズル（バレンタイン）", 1, 1, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", 24, 109102, 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 0.0, 2104010, 0, 1, 26001, -363.0, "2015/12/17 15:00:00", "シェフィ", 1, 2, "ここから先は神聖な場所みたい\nどんなお宝が眠っているのか、\n今から探索するのが楽しみね♪", 26, 106401, 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 0.0, 0, 0, 1, 26002, -363.0, "2015/12/17 15:00:00", "ペコリーヌ", 1, 1, "ここから先は神聖な場所\nみたいです！\nどんなお宝が手に入るか\n楽しみですね！", 26, 105801, 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 0.0, 0, 0, 1, 26003, -363.0, "2015/12/17 15:00:00", "キャル", 1, 1, "この先は神聖な場所みたい。\n手に入るお宝も並じゃないけど\n気を付けていかないと\n痛い目にあうわよ", 26, 106001, 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 0.0, 0, 0, 1, 26004, -363.0, "2015/12/17 15:00:00", "コッコロ", 1, 1, "ここから先は神聖な場所\nでございます。\n気を引き締めてお宝の\n調査探索に参りましょう", 26, 105901, 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 0.0, 2104010, 0, 1, 27001, -363.0, "2015/12/17 15:00:00", "シェフィ", 1, 2, "ここにさらなる力を得るための\nアイテムが眠っている…って\nみんな言ってるわ。ふふっ、\nそれじゃあ挑戦してみましょうか", 27, 106401, 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 0.0, 0, 0, 1, 27002, -363.0, "2015/12/17 15:00:00", "ペコリーヌ", 1, 1, "ここにさらなる力を得るための\nアイテムが眠っているみたい\nです！　どこから挑戦するか\n迷っちゃいますね！", 27, 105801, 0.0);
