INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 0.0, 0, 0, 1, 43003, -363.0, "2015/12/17 15:00:00", "キャル", 1, 1, "ここからアリーナに\n挑戦できるわよ！\nしっかり編成を考えて\nライバルに挑みなさい！", 43, 106001, 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 0.0, 0, 0, 1, 43004, -416.5, "2015/12/17 15:00:00", "アメス", 1, 1, "ミッションをクリアすると報酬が\n受け取れるわ。ジャンジャン\nクリアしてバリバリ強化して\nあげなさい♪", 44, 123001, 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 0.0, 0, 0, 2, 43005, -416.5, "2015/12/17 15:00:00", "アメス", 1, 1, "ぼんやりしてる場合じゃないわ。\n早くミッションをクリアして\n報酬を受け取ってきなさい！", 44, 123001, 0.0);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", 0.0, 0, 0, 3, 43006, -416.5, "2015/12/17 15:00:00", "アメス", 2, 1, "ちょっとあんた、報酬が\n受け取れるじゃない！\n忘れずにチェックなさい。\nアメス様との約束よ？", 45, 123001, 5.79);
